import React, { useState, useEffect } from "react";
import { useParams } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';
import { useLocation } from 'react-router-dom';
import { Routes, Route, Link, Outlet } from 'react-router-dom';
import Table from "./Table";
export default function Main_Component(props) {
    const [jobsDetails, setJobsDetails] = useState(apiCall())


    useEffect(() => {
        async function apiCall() {
            try {
                let response = await fetch('http://localhost:3003/api/getAll');
                response = await response.json()
                // alert(response)
                setJobsDetails(response);
            } catch (error) {
                console.error(error);
            }
        }

        apiCall()

    }, []);
    return (<div>
        <h1 className="h1">JobLocator</h1>
        <Table jobsDetails={jobsDetails}></Table>
    </div>);
}
